import React, { useState } from 'react';
import SearchItems from './SearchItems';
import { School_2_Codes_Dict } from "../data/School_to_Code";
import { tuitionQuery } from "../utils/TuitionAPICall";

function InputTable(props) {
  const { input1, setInput1, input2, setInput2, tableData, tuitionState, setTuitionState } = props;

  const handleSubmit = (e) => {
    e.preventDefault();
    props.onSubmit({ input1, input2 });
    setInput1("");
    setInput2("");
  };

  const [tuitionInState, setTuitionInState] = useState(null);
  const [tuitionOutOfState, setTuitionOutOfState] = useState(null);

  const handleTuitionQuery = (schoolId, residency) => {
    tuitionQuery(schoolId, residency).then(tuition => {
      if (residency === "In State") {
        setTuitionInState(tuition);
      } else {
        setTuitionOutOfState(tuition);
      }
    });
  };

  return (
    <div>
      <div className="input-table-container">
        <h1 className="my-header">College Comparison Tool</h1>
        <h2 className="my-subheader">Find and Compare the ROI in your Education</h2>
        <SearchItems input1={input1} setInput1={setInput1} input2={input2} setInput2={setInput2} handleSubmit={handleSubmit} tuitionState={tuitionState} setTuitionState={setTuitionState} />
        <table>
          <thead>
            <tr>
              <th>College</th>
              <th>Major</th>
              <th>In/Out State</th>
              <th colspan="2">Cost of attendance</th>
              <th colspan="3">Median Salary</th>
            </tr>
            <tr>
              <th></th>
              <th></th>
              <th></th>
              <th>1 yr.</th>
              <th>4 yrs.</th>
              <th>6 yrs.</th>
              <th>3 yrs.</th>
              <th>1 yr.</th>
            </tr>
          </thead>
          <tbody>
          {tableData.map((data, index) => {
            handleTuitionQuery(School_2_Codes_Dict[data.input1], data.tuitionState);

            return (
              <tr key={index}>
                <td>{data.input1}</td>
                <td>{data.input2}</td>
                <td>{data.tuitionState}</td>
                <td>{tuitionState === "In State" ? tuitionInState : tuitionOutOfState}</td>
                <td>{"$ COST"}</td>
                <td>{"$ SALARY"}</td>
                <td>{"$ SALARY"}</td>
                <td>{"$ SALARY"}</td>
              </tr>
            );
          })}
          </tbody>
        </table>
      </div>
      <div className="text-container">
        <h3 style={{ fontSize: '30px' }}>About this Calculator</h3>
        <p>
          This tool provides data of cost of attendance and median salary of
          post graduates for specific college majors. This data is based on
          national information of in-state and out of state tuition, as well
          as 1, 3, and 6 year graduates from the college programs.
        </p>
      </div>
    </div>
  );
}

export default InputTable;
